import React from 'react'

export default function SideDesign() {
  return (
    <body style="font-family: 'Arial', sans-serif; margin: 0; padding: 0; background-color: #f4f4f4;">

    <div style="padding: 20px; text-align: left; background-color: #3498db; color: #3A9188;">
        <h1 style="margin: 0; font-size: 36px;">Labify</h1>
        <p style="margin: 5px 0 0; font-size: 14px; color: #000000;">...making labs a better place</p>
    </div>

   

</body>
  )
}
